import { GoogleGenAI } from "@google/genai";
import mime from "mime";
import { writeFile } from "fs";

function saveBinaryFile(fileName: string, content: Buffer) {
  writeFile(fileName, content, "utf8", (err) => {
    if (err) {
      console.error(`Error writing file ${fileName}:`, err);
      return;
    }
    console.log(`File ${fileName} saved to file system.`);
  });
}

async function main() {
  const ai = new GoogleGenAI({
    apiKey: process.env.GEMINI_API_KEY,
  });
  const config = {
    responseModalities: ["image", "text"],
    responseMimeType: "text/plain",
  };
  const model = "gemini-2.0-flash-exp-image-generation";
  const contents = [
    {
      role: "user",
      parts: [
        {
          text: `could you generate an image of cat for me?`,
        },
      ],
    },
    {
      role: "model",
      parts: [
        {
          text: `I will generate an image of a fluffy, ginger tabby cat with bright green eyes, sitting attentively with its tail curled gently around its paws on a soft, cream-colored blanket. The lighting will be soft and warm, highlighting the texture of its fur.
`,
        },
        {
          fileData: {
            fileUri: files[0].uri,
            mimeType: files[0].mimeType,
          },
        },
        {
          inlineData: {
            data: ``,
            mimeType: `image/png`,
          },
        },
      ],
    },
    {
      role: "user",
      parts: [
        {
          text: `could you memorize my question and history dialouge?
`,
        },
      ],
    },
    {
      role: "model",
      parts: [
        {
          text: `I can access and process information from our current conversation, but I do not have memory of past conversations or questions in the way a human does. Each interaction starts fresh.`,
        },
      ],
    },
    {
      role: "user",
      parts: [
        {
          text: `how are you today`,
        },
      ],
    },
    {
      role: "model",
      parts: [
        {
          text: `I am functioning well today. Thank you for asking. How can I help you?`,
        },
      ],
    },
    {
      role: "user",
      parts: [
        {
          text: `what is my last question
`,
        },
      ],
    },
    {
      role: "model",
      parts: [
        {
          text: `Your last question was "could you memorize my question and history dialouge?".`,
        },
      ],
    },
    {
      role: "user",
      parts: [
        {
          text: `INSERT_INPUT_HERE`,
        },
      ],
    },
  ];

  const response = await ai.models.generateContentStream({
    model,
    config,
    contents,
  });

  for await (const chunk of response) {
    if (
      !chunk.candidates ||
      !chunk.candidates[0].content ||
      !chunk.candidates[0].content.parts
    ) {
      continue;
    }
    if (chunk.candidates[0].content.parts[0].inlineData) {
      const fileName = "ENTER_FILE_NAME";
      const inlineData = chunk.candidates[0].content.parts[0].inlineData;
      let fileExtension = mime.getExtension(inlineData.mimeType || "");
      let buffer = Buffer.from(inlineData.data || "", "base64");
      saveBinaryFile(`${fileName}.${fileExtension}`, buffer);
    } else {
      console.log(chunk.text);
    }
  }
}

main();
